import React from "react";
import { films } from "../../data.js";

const listItems = films.map((film) => (
  <li id={film.id}>
    <img className="film-image" src={film.image}></img>
    <h1>{film.name}</h1>
    <h2>{film.genre}</h2>
    <h2>{film.producer}</h2>
    <h2>{film.imdb}</h2>
    <h2>{film.description}</h2>
  </li>
));

export default function ListItems() {
  return <div>
    <ul>
      {listItems}
    </ul>
  </div>;
}
